import React, { useState } from "react";

function Input(){

    const [value, setValue]= useState(0);

    function handleChange(event){
        let x= even.target.value;
        setValue(x);
    }

    return (
        <input type="number" value={value} onChange={(e) => handleChange(e)} className= "cell"></input>
    )
}

export default Input;
